#include <iostream>
using namespace std;
int main() {
    int x = 10, y = 20;
    cout << "x is " << x << endl;
    cout << "y is " << ++x << endl; // this line prints 11
    return 0;
}
``` The output of this program is `x is 10`, `y is 11`. I don't understand why it doesn't print `y is 21`. In my opinion, when we use `++x` in the second statement, it should increase the value of `x` by one and then assign that to `y`. But it seems like it first increases the value of `x` by one and then assigns that to `y`.

